import { BrowserRouter as Router, Routes, Route, Outlet } from 'react-router-dom';
import NotFound from './Pages/NotFound/NotFound';
import Footer from './Components/Footer/Footer';
import Login from './Pages/Login/Login';
import NoLayout from './Layouts/NoLayout/NoLayaout';
import UserLayout from './Layouts/UserLayout/UserLayaout';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<NoLayout />}>
          <Route index element={<Login />} /> {/* Esto hace que Login se renderice en "/" */}
          <Route path="Login" element={<Login />} /> {/* Tambi√©n accesible en "/Login" */}
          <Route path="Register" element={<Register />} />
        </Route>
        <Route path="" element={<UserLayout />}>
          <Route/>
        </Route>
        <Route path="*" element={<NotFound />} />
      </Routes>
    </Router>
  );
}

export default App;
